import ImgLogo from './logovuavia.png';
import Banner from './banner.png';
import share1 from './chia-se-moi-nhat-1.png'
import share2 from './chia-se-moi-nhat-2.jpg';
import share3 from './chia-se-moi-nhat-3.jpg';
import share4 from './chia-se-moi-nhat-4.jpg';

const Logo = {
    Banner,
    ImgLogo,
    share1,
    share2,
    share3,
    share4,
};
export default Logo;
